xwikidoc.content:
XWiki automatically tracks 3 types of statistics information across time:
* Document statistics: ** The action made on documents ("view", "save", "delete", etc). This allows knowing how many pages are viewed, downloaded, edited, deleted, etc. ** The number of unique visitors for that document. ** The number of visits for that document (non unique visitors). * Referrer statistics: ** The address (URL) of web pages linking to your wiki. * Visit statistics: ** The number of saved pages during a visit. ** The number of downloaded pages during a visit. ** The starting date of a user visit. ** The ending date of a user visit. ** The unique id of a user visit. ** The cookie id of the user. ** The IP address of the user. ** The user agent of the user.
